public: MyClass(std::string name) : name_{name} { std::cout << "Constructor called " + name_ << std::endl; } ~MyClass() { std::cout << "Destructor called " + name_ << std::endl; }
private: std::string name_;
}; int main() { { // Create a scope to demonstrate smart pointer behavior std::unique_ptr<MyClass> u_ptr = std::make_unique<MyClass>("unique"); MyClass* raw_ptr = new MyClass("raw"); } // end of scope; u_ptr goes out of scope, destructor is called automatically // raw_ptr is not deleted, causing a potential memory leak return 0;
} std::shared_ptr: Shared ownership: multiple std::shared_ptr can point to the same resource. Reference counting: the resource is deleted when the last std::shared_ptr goes out of scope. #include <iostream>
