public: MyClass() { std::cout << "MyClass constructor\n"; } ~MyClass() { std::cout << "MyClass destructor\n"; }
}; int main() { std::shared_ptr<MyClass> sp1 = std::make_shared<MyClass>(); std::cout << "Use count: " << sp1.use_count() << std::endl; { std::shared_ptr<MyClass> sp2 = sp1; std::cout << "Use count: " << sp1.use_count() << std::endl; } std::cout << "Use count: " << sp1.use_count() << std::endl; return 0;
} std::weak_ptr Weak reference: does not affect the reference count of the shared resource. Desn't increase the reference count. Used to prevent circular references in shared ownership. #include <iostream>
#include <memory> class NodeB; // forward declaration class NodeA {
public: std::shared_ptr<NodeB> strong_ptr; // Strong reference to NodeB std::weak_ptr<NodeB> weak_ptr; // Strong reference to NodeA NodeA() { std::cout << "NodeStrong constructor\n"; } ~NodeA() { std::cout << "NodeStrong destructor\n"; }
