}; int main() { { // create scope std::cout << "Entering first scope..." << std::endl; // Create NodeA and NodeB, each referencing the other. auto a = std::make_shared<NodeA>(); auto b = std::make_shared<NodeB>(); a->strong_ptr = b; // NodeA has a strong reference to b b->strong_ptr = a; // NodeB has a strong reference to a std::cout << "Exiting first scope..." << std::endl; } // end scope // Here, a and b go out of scope, but each Node holds a strong pointer to the other. // Their reference counts never reach zero, so destructors are NOT called. // This leads to a memory leak because NodeA and NodeB remain alive, referencing each other. { // create new scope std::cout << "Entering second scope..." << std::endl; auto a = std::make_shared<NodeA>(); auto b = std::make_shared<NodeB>(); a->strong_ptr = b; // NodeA has a strong reference to b b->weak_ptr = a; // NodeB has a weak reference to a std::cout << "Exiting second scope..." << std::endl; } return 0;
