Lambda functions (also called lambda expressions) in C++ are unnamed (anonymous) functions that you can define inline. They were introduced in C++11 to make it easier to create small, concise functions, especially for use with the Standard Template Library (STL) algorithms or as callbacks. Unlike regular functions, they can capture variables from their surrounding scope. This is incredibly useful for passing context to a function on-the-fly. Syntax: [ capture_list ] ( parameter_list ) -> return_type { // function body
} capture_list: Specifies which variables from the enclosing scope are available inside the lambda and how they are captured (by value, by reference, etc.). parameter_list: The parameters the lambda accepts (similar to a function’s parameter list). return_type: Often omitted because it can be deduced by the compiler, but can be specified explicitly using -> return_type. function body: The code that executes when the lambda is called. Example of lambda function usage: #include <iostream>
#include <vector>
#include <algorithm> int main() { std::vector<int> nums = {5, 2, 8, 3, 1}; std::sort(nums.begin(), nums.end(), [](int a, int b) { return a < b; }); for (int num : nums) { std::cout << num << ' '; } return 0;
} Discussion Points: How does the lambda function work in std::sort? When should you use lambdas over named functions? #include <iostream>
#include <vector>
#include <algorithm> int main() { std::vector<int> values = {1, 2, 3, 4, 5}; int offset = 10; auto printValue = [](int val) { std::cout << val << " "; }; // Capture everything by value (copy std::for_each(values.begin(), values.end(), [=](int val) { // modifies copy of 'val', not `val` itself val += offset; // offset += 1; // error: 'offset' cannot be modified. Can use [=]() mutable {...} to modify }); std::for_each(values.begin(), values.end(), printValue); // Capture everything by reference std::for_each(values.begin(), values.end(), [&](int &val) { val += offset; // modifies 'val' directly in the vector via reference offset += 1; }); std::for_each(values.begin(), values.end(), printValue); std::cout << std::endl; return 0;
}

