Condition variables allow threads to wait (block) until they are notified that some condition is true. They typically work with a mutex to ensure correct data access. // Example 5: Producer-Consumer with Condition Variables
#include <iostream>
#include <thread>
#include <mutex>
#include <condition_variable>
#include <queue> std::mutex mtx;
std::condition_variable cv;
std::queue<int> dataQueue;
bool finished = false; void producer() { for(int i = 1; i <= 5; ++i) { { std::lock_guard<std::mutex> lock(mtx); dataQueue.push(i); std::cout << "Produced: " << i << "\n"; } cv.notify_one(); // Notify one waiting thread std::this_thread::sleep_for(std::chrono::milliseconds(100)); } // Signal that production is finished { std::lock_guard<std::mutex> lock(mtx); finished = true; } cv.notify_all();
} void consumer() { while(true) { std::unique_lock<std::mutex> lock(mtx); cv.wait(lock, []{ return !dataQueue.empty() || finished; }); if(!dataQueue.empty()) { int value = dataQueue.front(); dataQueue.pop(); std::cout << "Consumed: " << value << "\n"; } else if(finished) { break; // No more data } }
} int main() { std::thread prod(producer); std::thread cons(consumer); prod.join(); cons.join(); return 0;
} Explanation: The producer thread pushes data to dataQueue and notifies the consumer. The consumer thread waits (cv.wait) until it is notified that either new data is available or production is finished. cv.wait(lock, condition) atomically unlocks the mutex and sleeps until condition is true, then locks the mutex again before returning.

