Now you will refine your line-following strategy by implementing Proportional Control (P-Control) . Unlike Bang-Bang control, which causes abrupt movements, P-Control allows the robot to adjust its movement smoothly based on how far the estimated line position deviates from the robot’s center. The goal is to achieve smoother and more stable tracking of the line. Previously you implemented Bang-Bang control , which relied on strict ON/OFF decisions. This approach worked but led to oscillations and jerky movement , as the robot continuously switched between turning left and right. These issues make it difficult for the robot to follow curves or move efficiently at higher speeds . Proportional control solves this by introducing a continuous adjustment to the robot’s turning speed. Instead of making binary decisions, the angular velocity ω is determined using a proportional gain KP and the error e , which represents the difference between the estimated line position x and the robot's center x0 : $$ e = x - x_{0} $$ By multiplying this error by KP , we obtain the angular velocity: $$ ω = K_{P} \cdot e $$ This means that when the robot is far from the center , it turns more sharply . When it is close to the center , it makes minor corrections . If the line is perfectly centered, the robot moves straight. The higher the proportional gain KP , the stronger the response to the error. However, if KP is too high, the robot may start oscillating. The process of P-Control is illustrated in Figure 2 . The robot reads the estimated position of the line, calculates the error, applies the proportional formula to determine angular velocity, and then sends this velocity to the motion control node, which executes the movement. Figure 2: Flowchart for P-Control Line Follower A key part of implementing P-Control is choosing the right value for KP . If KP is too small, the robot will react very slowly and may fail to follow the line accurately. If KP is too large, the robot might oscillate too much and become unstable. The best approach is to start with a low value of KP and gradually increase it, observing how the robot’s movement improves. TASK 2 Insert the provided pid.hpp file into the include/algorithms directory. This header defines a basic PID controller class, which you will use for both Task 2 (P-control) and Task 3 (full PID) . #pragma once #include <iostream>
#include <chrono> namespace algorithms { class Pid { public: Pid(float kp, float ki, float kd) : kp_(kp), ki_(ki), kd_(kd), prev_error_(0), integral_(0) {} float step(float error, float dt) { integral_ += error * dt; float derivative = (error - prev_error_) / dt; float output = kp_ * error + ki_ * integral_ + kd_ * derivative; prev_error_ = error; return output; } void reset() { prev_error_ = 0; integral_ = 0; } private: float kp_; float ki_; float kd_; float prev_error_; float integral_; };
